import React from 'react';
import bachelorArticle from '../assets/bachelor.png';
import './styles.css';

export default function Projects() {
    return (
        <div className="Body">
            <h1>Projects</h1>
            <ProjectCard imageSrc={bachelorArticle} title="Article, describing my Bachelors data" />
        </div>
    )
}

const ProjectCard = ({ imageSrc, title }) => {
    return(
        <div className="Cards">
            <h3>{title}</h3>
            <img src={imageSrc} alt="Article" />
        </div>
    )
}
